import "./style.css";

function Contact(){
    return(
        <section className="contact">
            <div className="contact_top">
                <div>
                    <h1>Contact us</h1>
                </div>
            </div>

            <div className="contact_container">
                <div className="left_side"></div>
                <div className="right_side"></div>
            </div>
        </section>
    )
}

export default Contact;
